// JavaScript Document
import React from 'react';
import ParkGridHome from '../components/grids/parkGridHome';
import States from '../components/USA_states/states';
import Map from '../components/map/map';


//Material UI
import {withStyles} from '@material-ui/styles';
import Grid from "@material-ui/core/Grid";

const useStyles = {
  root:{
	direction:'row',
	flexGrow:'1',
	margin:'1%',
	},
container:{
    display: 'flex',
	 flexWrap: 'wrap',
	justifyContent: 'space-around',
	overflow: 'hidden',
	},
gridList: {
	padding:'0.4%',
  },
paper: { 
    textAlign: 'center',
		width:'400px',
		height: '300px',
		listStyleType:'none',
		backgroundColor:'white',
  },
indImgs:{
	height: '100%',
	width:'100%',
	},
};

class Index extends React.Component {

	linkClick(event) {
	window.onclick= event => {
	 //console.log(event.target);
	 //console.log(event.target.id);
	  var targetId = event.target.id;
	  window.location.assign(`http://localhost:3000/stateActivities/${targetId}`);
	};
};
  render() {
    return(
    <div style={styles.container}>
      <Grid container >
	  		<Grid item xs={12} md={4}>
        		<ParkGridHome />
       		</Grid>
	  		<Grid item xs={12} md={8} style={styles.rightContainer}>
	  			<Grid container>
	  				<Grid item xs={12} style={styles.map}>
	  					<Map />
	  				</Grid>
      				<Grid item xs={12} >
	  					<States />
            		</Grid> 
        		</Grid>
	  		</Grid>
      	</Grid>
    </div>
  	);
  }
}

export default Index;
const styles ={
	container:{
		flexGrow: '1',
		overflow:'hidden',
		textAlign:'left',
	  marginBottom:'0%',
		justifyContent: 'space-around',
	},
	rightContainer:{
		padding:'5%',
		marginTop:'-5%',
	},
	map:{
		textAlign:'center',
	},
}
